import React from "react";
import { AppBar, Toolbar, Typography, Fab } from "@material-ui/core";
import Add from "../add-button/Add";
import Compare from "../compare-button/Compare";

export default () => {
  return (
    <AppBar>
      <Toolbar>
        <Typography variant="headline" color="inherit">
          Disc Golf Disc Search Tool
          <Fab>
            <Add />
          </Fab>
        </Typography>
      </Toolbar>
    </AppBar>
  );
};
